 (4,'dongzuopian','动作片','http://www.suku.cc/film17/4794/','终极杀阵3','全集','弗雷德里克·迪方多萨米·那瑟里','欧美','2009-7-14 19:25:12','莉莉受不了丹尼尔爱车如命，搬回了父母家；贝特拉整天跟艾米连闹别扭，搞得埃米连不敢回家，整天躲在局里。　　华裔和欧洲人的联合犯罪集团在圣诞节期间大肆活动，他们假扮圣诞老人，把马赛搅得天翻地覆。 　　高大但不威猛的局长于贝尔部署手下进行白雪行动，却不知道他身边的混血女记者裘就是盗贼团的首领。裘拿到了局在圣诞期间的各种部署资料，马赛自然屡战屡败，丢尽面子。 　　影片两位主角、无牌司机和笨蛋顾不上抓贼，他们的女友都怀了孕，还都跟他们闹翻了。两人正在车里对诉衷肠，却碰上了一个在凌晨出没的圣诞老人，两人追踪到盗贼团巢，埃米连再次掉进垃圾桶，被盗贼们抓住。 　　虽然丹尼尔在头仓库里救出了埃米连，但局长却被裘耍了，盗贼们从合围中逃之夭夭（这一段很搞笑的，满街跑圣诞老人）。白雪行动失败，盗贼团逃往法国-瑞士边境。 　　为了夺回贝特拉送给埃米连的手机，两搭档开车追到法瑞边境的滑雪胜地，终于找到正准备越境的盗贼团。他们急召救兵，将军岳父和局长率领空降兵赶到，抓住盗贼团。埃米连夺回了宝贝手机，丹尼尔除了又作了次无名英雄之外，捎带脚还拿了个滑雪比赛冠军。 搞笑 　　整整90分钟，整个电影院都在不停地笑，所有人笑到后来都笑得有气无力。 　　所有第二集的搞笑人马都再次出场，样子很甜子很辣的莉莉，气质有点像路易&middot;德菲奈斯的将军岳父，还有他总是遇上车祸的倒霉司机。 　　贝特拉怀孕8个月，埃米连天天跟她睡在一起，居然一直都不知道（幸亏法国政府除了给小孩儿发补贴之外什么都不管，如果这事儿发生在，孩子就成&lsquo;黑户了）。 　　裘用英语告诉于贝尔局长自己杂志的名字，于贝尔的英语跟他的日语差不多，此后每次提到那杂志，就用哼哼唧唧代替。 　　丹尼尔拿着莉莉的验孕棒冲进药店问老板这是什么意思，老板叫过自己在医学院读书的女儿，问她这是什么意思？女儿诚恳地说这是个意外，老爸 　　那个搞笑的黑冲到街中间，高举证拦车，被汽车毫不犹豫地撞翻法国司机（特别是法国南部的司机）糟糕得不可思议，我来法国四个月，看见司机转弯时打转向灯的次数还没有看见的车祸多。 　　近期法国喜剧片有无厘头化的倾向，去年的《任务》简直比《少林足球》更周星驰，本片有一个笑料也差不多，局长跳伞前高呼Attendez Me！一半英文一半法文拼在一起，跟I服了you有一拼。 　　还有一个很温馨的笑话，丹尼尔知道莉莉怀孕之后，开车送女友和准岳父时，把车开得比六十岁阿婆走路还慢。 特技 　　在开场的轮滑对BMX车的段落，使用微型摄像机拍摄从自行车车把、轮滑鞋侧面等角度的镜头。　　影片中段，盗贼团出动了巨型四轮驱动车，车轮比警车还高。　　压轴戏雪山追逐中，那辆标致居然改用履带行驶，好像装甲车一样。来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索终极杀阵3在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"1集\" href=\"/film17/4794/play-0-0.html\" target=\"_self\">\n   1集\n  </a>\n </li>\n <li>\n  <a title=\"2集\" href=\"/film17/4794/play-0-1.html\" target=\"_self\">\n   2集\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/20087111254215163.jpg','2003'),
 (5,'dongzuopian','动作片','http://www.suku.cc/film17/4804/','剑侠雄心','全集','贾斯汀·钱伯斯凯瑟琳·德纳芙','欧美','2009-7-14 19:25:12','《剑侠雄心》是导演兼摄影彼得-海姆斯，根据大仲马的经典传奇名著《三个火枪手》改编的一部风格清新的新作。 　　年轻的达达尼昂为了报父母被杀害的仇，面对巴黎的各色人等，上至皇后和大主教，下至小街陋巷里的贫民，周旋争斗中演出一幕幕激烈好戏。勇士，恶棍，美人，政客，宫廷，酒肆，旅馆，街头，爱恨情仇交织在17世纪的巴黎。达达尼昂在巴黎的屋顶上跳跃闪躲，凭着勇气和正义，好斗与多情，在家族的纠葛、国家的危机中书写火枪手的前传。 　　富有传奇色彩的动作设计师熊欣欣，设计了该片令人眩目的打斗场面，将东的风格和传统融合起来，取得了奇妙的效果。 幕后 　　本片最引人注目无疑是演员阵容。真是引人入胜让人放心。贾斯汀&middot;钱伯斯此前曾在詹妮弗&middot;洛佩兹的《缘分没法挡》中扮演过角色，此番是他首度出演主角，但他为卡尔文&middot;克莱因做香水模特，气质颇佳，很适合这样浪漫主义的人物。扮演法国皇后的德诺芙绝对是法国真正的电影皇后，她的脸曾被当作法国的象征，美丽高贵，让人难忘的优雅，不仅是电影界而且是时尚界几十年追逐的目标，多年的电影生涯只让她更増魅力，演皇后自是水到渠成。 　　有英雄就有美人，而让达达尼昂一见倾人的美人正是标准的美国美人米娜&middot;苏瓦莉。凯文&middot;斯派西的玫瑰梦只怕要留名青史了，睡在玫瑰花瓣里的女孩此番成了活泼的法国姑娘，穿着旧的长裙，仰着的笑脸却有珍珠般的光泽，任何人爱上她，都是容易之极的一件事。凭她的样貌和聪明，若能接着现在的势头，在《美国美人》、《美国派》之后再出演一些叫好叫座的影片，年轻的她肯定会在好莱坞一线女演员名单中牢牢占据一席。 　　大名鼎鼎的红衣主教黎塞留是个重要而神秘的人物，没有很多人真的理解他，扮演他的斯蒂芬&middot;雷阿出生 于贝尔法斯特，无论演多么奇怪的人物都能让人对他有一种理解似的同情，不知红衣主教在他演来是什么样子。演法布尔的蒂姆&middot;罗思则具有特殊的魅力又带点，一张柔和多变的英国人的脸。看看他出演过的电影名单《落水狗》、《低俗小说》、《四个房间》（均为昆汀&middot;塔伦蒂诺作品）、《人人都说我爱你》、《厨子、贼、他的妻子和她的情人》、《巴黎》、《百万美元酒店》，还有今夏巨片《决战猩球》。他演的坏人都是有魅力的坏蛋，绝不简单。来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索剑侠雄心在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"1集\" href=\"/film17/4804/play-0-0.html\" target=\"_self\">\n   1集\n  </a>\n </li>\n <li>\n  <a title=\"2集\" href=\"/film17/4804/play-0-1.html\" target=\"_self\">\n   2集\n  </a>\n </li>\n <li>\n  <a title=\"3集\" href=\"/film17/4804/play-0-2.html\" target=\"_self\">\n   3集\n  </a>\n </li>\n <li>\n  <a title=\"4集\" href=\"/film17/4804/play-0-3.html\" target=\"_self\">\n   4集\n  </a>\n </li>\n <li>\n  <a title=\"5集\" href=\"/film17/4804/play-0-4.html\" target=\"_self\">\n   5集\n  </a>\n </li>\n <li>\n  <a title=\"6集\" href=\"/film17/4804/play-0-5.html\" target=\"_self\">\n   6集\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/20087111382748368.jpg','2001'),
