 (7,'dongzuopian','动作片','http://www.suku.cc/film17/4777/','寻找命运之矛的探险','全集','诺厄·怀尔鲍勃·纽哈特凯尔·麦克拉克伦珍·柯婷奥林匹·杜卡基','欧美','2009-7-14 19:25:07','曾经在一篇日志中提到过拍摄以图书馆员为主角的电影，转眼间就成了现实了。《THE LIARIAN: QUEST FOR THE SEAR 》是一部惊险刺激的冒险片，讲述了一个书呆子在圣物落入坏人之手后如何拯救世界的故事。这部影片已经于美国时间12月5日晚八时进行了首演，为此ALA的公共信息部门(ublic Information Office )还将进行一项问卷调查。 　　故事梗概大致是年方30且富有才气的Carsen被他的教授扫地出门，因为教授认为在Carsen拿了22个学位却极度缺乏社会经验的情况下，让Carsen继续求学将是对Carsen的一种伤害。与此同时，Carsen的母亲也开始让他赶紧谈恋爱，并且积极的安排他与素未蒙面人进行约会。一天Carsen收到一份神秘的邀请，让他去首都的公共图书馆进行面试。经过一次古怪但成功的面试之后，　Charlene和图书馆领导Judson 告诉了Carsen这份工作的，这是一份已经存在了几个世纪的秘密工作。他被安排承担一项负责保护历史上最伟大的珍品的工作，这些珍品被保存在图书馆的秘密场所。在这些珍品中包括〈圣经〉约柜 、蒙娜丽莎、潘多拉盒子、传说中亚瑟王的神剑，以及命运之矛的三分之一。 　　在恶毒的兄弟会(Serent otherhood)成员闯入图书馆，并把图书馆所藏的那一份命运之矛(the Sear of Destiny)给偷走时，Carsen发现这份工作并不象合同中所写的那么简单。命运之矛是一件古老的圣物，被认为他的拥有者能够控制整个世界的命运。因此他必须找到命运之矛的其他两部分以免它们落入歹人之手。 　　在兄弟会的跟踪之下，Carsen和另一个女馆员Nicole Noone一起前往了亚马逊河流域。他们的冒险经历，就像绝大多数探险影片一样，悬崖峭壁，原始部落等等，最终他们落入了兄弟会的手里。他们Carsen和Nicole帮他们去寻找到生命之矛的剩余部分。循着线索，他们来到了传说中位于世界另一边的居于喜马拉雅山之中的香格里拉王国 。就在兄弟会要把全部三份命运之矛给合起来并利用他的威力来统治世界之时，Carsen证明了他那么多年的书是没有白读的。他也已经准备好去面对任何将来的危险。 　　该片演员阵容强大《急诊室的天》影集的男主角之一- 诺亚?怀勒（Noah Wyle）就在其中，虽然故事梗概是好莱坞用的多了的题材，但难得男女主角都是图书馆员，看看多少还是能够让人异想天开一下的。来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索寻找命运之矛的探险在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"1集\" href=\"/film17/4777/play-0-0.html\" target=\"_self\">\n   1集\n  </a>\n </li>\n <li>\n  <a title=\"2集\" href=\"/film17/4777/play-0-1.html\" target=\"_self\">\n   2集\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/20087821252492568.jpg','2004'),
 (8,'dongzuopian','动作片','http://www.suku.cc/film17/4772/','十万火急龙出生天','全集','史泰龙','欧美','2009-7-14 19:25:07','联接曼哈顿和新泽西州的海底隧道是当地的交通枢纽，一次，一宗意外发生的大爆炸使得隧道被封塞，很多无辜市民被围困在了里面，其生命随时受到威胁。　　地面的警方获悉这一事故马上出动大量人员赶到现场，但苦于隧道口已被堵塞，且里面又有毒气弥漫而一时束手无策。这时，已被革职的前救生队队长骆查赶到。出于职业的本能和强烈的救人意识，他一面与迟迟不敢行动的警方唇枪舌战，一面执意孤身冒着生命危险通过飞转的隧道排风口进入了危机四伏的地狱般的隧道。　　面对着突如其来的骆查，隧道里的人一阵欣喜，但当发觉仅来了骆查一人后，众人又陷入了极度的绝望甚至怀疑，讽刺骆查的勇猛行为。在骆查无私行动的感化下，众人摒弃了相互的埋怨，生存的乐观逐渐在他们心中滋长。但是，接踵而来的塌方，海水浸灌等还在不断扼杀着人们仅有的希望。在骆查的带领下，大家终于团结一致，齐心克服了一次次生命的威胁，希望的火苗又再现在众人心中燃起。可是，风云不测，克服了一个困难，他们又面临着更多的巨大挑战 终于，骆查察觉到逃生的耗子可以帮他们走向光明，尾随着耗子群，人们终于一步步走向活路。可是，为了救一条长期豢养的家狗，骆查不幸再次陷入困境，而为了助其摆脱困境，救人不成的另一女子也身陷苦海　　在骆查的引导帮助下，众人终于精疲力尽地躺在了地面救护队的担架上，而骆查与另一女子却还生死未卜。历经艰险的骆查俩人把最后的希望寄托在了唯一的一块炸药上。一声巨响后，隧道顶上炸开了一个大口，巨大的吸力终于把俩人托出了海面　　在太阳的光明下，骆查又被众人奉为英雄，人们再次称他为队长了，而骆查早已无意于这些，他此刻感到的只是一种油然而生的正义感...来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索十万火急龙出生天在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"1集\" href=\"/film17/4772/play-0-0.html\" target=\"_self\">\n   1集\n  </a>\n </li>\n <li>\n  <a title=\"2集\" href=\"/film17/4772/play-0-1.html\" target=\"_self\">\n   2集\n  </a>\n </li>\n <li>\n  <a title=\"3集\" href=\"/film17/4772/play-0-2.html\" target=\"_self\">\n   3集\n  </a>\n </li>\n <li>\n  <a title=\"4集\" href=\"/film17/4772/play-0-3.html\" target=\"_self\">\n   4集\n  </a>\n </li>\n <li>\n  <a title=\"5集\" href=\"/film17/4772/play-0-4.html\" target=\"_self\">\n   5集\n  </a>\n </li>\n <li>\n  <a title=\"6集\" href=\"/film17/4772/play-0-5.html\" target=\"_self\">\n   6集\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/20087820292531056.jpg','1996'),
