 (122,'dongzuopian','动作片','http://www.suku.cc/film17/7306/','烈火战车第二部极速传说','全集','郑伊健任达华','未录入','2009-7-14 19:28:48','速是一个生于富裕之家的年青人，母亲阮文凤乃商界有名的女强人，後父朱大森亦在中港财经界有着一定地位。 但恃才傲物不可一世的速，并没有受父母的影响经商从政，反而驾着他心爱的坐驾 拥有贵族般高贵的转子涡轮引擎的Rx-7跑车，疾走闹市街道之间，试图闯出自己的世界，创造出大都市中的极速传说。传说由速的生日开始，尽管速目空一切，极难相处，但围绕在速身边依然大不乏人，因速不单挥金如土，还有一手出神入化的飙车绝艺，吸引着一群喜爱追求速度刺激的年青人跟随。 \r\n　　当中尤以在速车房工作的熊猫和谢贤为最，熊猫生戆直，梦想是在赛车场上扬威，而谢贤则贪财贪玩，二人虽目的不同，却皆视速为偶像。 但在速的眼中，除了爱车Rx-7和他的女朋友希外，其馀的人包括生母和继父也全不放在眼内。 \r\n　　是夜，意气风发的速正和希及熊猫等人热烈庆祝的当儿，一直对速所作所为极之不满的丧寻 而至，要和速在速度上一决胜负，速谈笑接战，终於，展开了一场公路上的生死时速房车赛。 丧以丧为名，为求胜出，不顾命，强如速也几乎被丧同归於尽的驾车手法逼进鬼门关，幸好速终技胜一筹，险胜半秒，不但赢回面子，丧更失控撞栏，腿骨折断。可是，速并未因丧事打消兴致，相反和希在Rx-7上渡过了的一夜…… \r\n来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索烈火战车第二部极速传说在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"烈火战车二部极速传说1\" href=\"/film17/7306/play-0-0.html\" target=\"_self\">\n   烈火战车二部极速传说1\n  </a>\n </li>\n <li>\n  <a title=\"烈火战车二部极速传说2\" href=\"/film17/7306/play-0-1.html\" target=\"_self\">\n   烈火战车二部极速传说2\n  </a>\n </li>\n <li>\n  <a title=\"烈火战车二部极速传说3\" href=\"/film17/7306/play-0-2.html\" target=\"_self\">\n   烈火战车二部极速传说3\n  </a>\n </li>\n <li>\n  <a title=\"烈火战车二部极速传说4\" href=\"/film17/7306/play-0-3.html\" target=\"_self\">\n   烈火战车二部极速传说4\n  </a>\n </li>\n <li>\n  <a title=\"烈火战车二部极速传说5\" href=\"/film17/7306/play-0-4.html\" target=\"_self\">\n   烈火战车二部极速传说5\n  </a>\n </li>\n <li>\n  <a title=\"烈火战车二部极速传说6\" href=\"/film17/7306/play-0-5.html\" target=\"_self\">\n   烈火战车二部极速传说6\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/20085312194455294.jpg','未录入'),
