 (128,'dongzuopian','动作片','http://www.suku.cc/film17/4217/','大转折','全集','大战宁沪杭解放大西北南线大追歼','大陆','2009-7-14 19:28:41','1949年9月，在人民解放军强大的攻势下，国民党政府退据。为全歼国民党军队在的有生力量，摧毁国民党政权，解放全，中央决定成立西南局，由任西南局第一，刘伯承、贺龙任第二、第三，统一指挥第二野战军主力及第一、四野战军一部，共同完成解放大西南的任务。 　　为将敌人歼灭于四川境内，防止其逃往滇缅边境，贺龙率一野十八兵团在川北牵制敌胡宗南集团，刘邓指挥二野主力及四野一部迂回至湘鄂川黔地域向敌宋希濂兵团发起全线攻击，迅速突破敌防线，攻占了贵阳。蒋介石急忙命宋希濂、胡宗南压缩防线，守卫。我军乘胜出击前进，利用就便器材渡过乌江，攻占白马山，生俘敌十四兵团司令钟彬，胜利占领山城。 　　解放后，刘邓挥师向成都靠拢，贺龙也率部向川北疾进，以完成对成都的合围。　　我军向敌人实施军事打击的同时，也向敌方展开了强大的攻势。在党中央、周恩来副主席的亲自关心和刘邓的精心安排策动下，国民党西康省主席刘文辉、西南军政长官公署副长官邓锡侯、云南省主席卢汉先后率部起义。 　　宋希濂残部经半月的狼奔豕突，逃窜至川南峨边一带，被我歼灭，宋希濂被活捉。　　胡宗南为免被歼，经蒋介石批准，派第五兵团司令李文为总指挥，率部突围。敌人集中七个军的兵力向我邛崃守军发动集团式轮番进攻，我指战员英勇阻击敌人，为大部队展开赢得了宝贵时间。我主力部队在刘邓指挥下，将敌人分割包围，李文突围无望，后退无路，只得率部放下武器，向我投诚。蒋介石看到大势已去，于12月10日逃往台湾。 　　我军胜利进入成都，国民党在西南的最后一座城市终于回到了人民的怀抱。刘、邓、贺指挥60万人马仅用两个月时间，横扫云、贵、川、康四省之敌，歼敌90万，粉碎了蒋介石妄图建都、固守西南和卷土重来的最后梦想，为人民解放战争谱写了辉煌壮丽的篇章。来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索大转折在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"大转折A\" href=\"/film17/4217/play-0-0.html\" target=\"_self\">\n   大转折A\n  </a>\n </li>\n <li>\n  <a title=\"大转折B\" href=\"/film17/4217/play-0-1.html\" target=\"_self\">\n   大转折B\n  </a>\n </li>\n <li>\n  <a title=\"大转折c\" href=\"/film17/4217/play-0-2.html\" target=\"_self\">\n   大转折c\n  </a>\n </li>\n <li>\n  <a title=\"大转折d\" href=\"/film17/4217/play-0-3.html\" target=\"_self\">\n   大转折d\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/2008771040792200.jpg','2006'),
