 (134,'dongzuopian','动作片','http://www.suku.cc/film17/7198/','刺杀疑云有利地形','全集','丹尼斯·奎德马修·福克斯','未录入','2009-7-14 19:28:27','西班牙全球反恐怖首脑峰会如期举行，美国总统阿什顿（威廉·赫特饰）在众人簇拥下驾临。总统的贴身保镖秘密特工托马斯·伯恩斯（丹尼斯·奎德饰）和肯特·泰勒（马修·福克斯饰）机警万分、不离其左右。然而，就在阿什顿亮相西班牙的瞬间，危难发生了——不知从何方射来的子弹击中了美国总统。现场一片乱，总统被人暗杀……\r\n　　在混乱不堪的人群中，一个来自美国的观光客霍华德·刘易斯（福里斯特·惠特克饰）手中忙乱挥舞的家用摄像机恰巧记录下了这一历史的时刻，当他回家向儿子炫耀自己的摄影技术时恰巧看到了这一惊天的……\r\n　　就在总统遭暗杀的现场，负责新闻转播的一个美国电视节目制片人莱克斯（西格尼·韦弗饰），也正在现场报道此次反恐峰会。在前后短短15分钟的时间里，在莱克斯的视线里，则有着另一番对刺杀事件的景象和描述……\r\n关于主演\r\n　　新科黑人福里斯特·惠特克的加盟，无疑为影片在品质上提升了一个档次。《末世》中劲道十足的表演为这位德克萨斯人长达二十余年的演艺生涯划上了闪耀而浓重的一笔。眼下，惠特克脱下戎装，以美国游客的身份勇闯龙潭，并以独特的视角见证了美国总统遇刺的全过程。在与众多实力派同行的碰撞中游刃有余、轻松自然。尤其是与如丹尼斯·奎德等几位演技派对戏时常常能四溢、一气呵成。\r\n　　说起这位惠特克的德州老乡，给笔者最为深刻的就是那部神奇异常穿越时空的《生死频率》。事实上，奎德早在上个世纪70年代入行时，就以男人味儿十足的外表和坚毅阳刚的格给观众留下了深刻的印象。并在随后的一段时间里逐步确立了自己动作＋演技的实力派男星的地位。《大白鲨3》、与雪儿联手的《铁律柔情》、和梅格·瑞恩合作的《死亡漩涡》、与凯文·科斯特纳、吉恩·哈克曼等一班胡渣爷们儿的西部片《义海倾情》、奎德独挑大梁的战争片《拯救者》……新世纪后，皱纹渐显的丹尼斯·奎德演技愈发精湛同样群星闪耀的《贩毒网络》、体育励志片《棒球新秀》、警醒世人的《末日浩劫》、温馨搞笑的《新欢乐满堂》、以及这部重返硬汉舞台的《刺杀疑云》，无不为其琳琅满目的成绩表上再添精彩。\r\n　　再说说大银幕新丁——马修·福克斯。这位外表俊朗、健康的帅小伙虽阅历尚浅，但其卖力敬业以及先天的表演天分却已然在短短的几年内为自己闯出了一片天。事实上，马修·福克斯有今天如此的这一切很大程度上得意于年幼时以及后来的成长经历，这当中当然包括家人的无私支持和鼓励以及他自己的不懈地进取和努力。马修·福克斯的第一次银幕触电还要追溯到十几年前的1992年，电视剧《新人宿舍》的上映可谓是令这位最初以外形取胜的年轻人一炮走红。也使得马修在众多观众们心中打下了很高的第一印象分。紧接着，这位从新人宿舍中走出来的毛头小子便开始了自己忙碌的演艺事业。电视剧《醒后死去》（If I Die Before I Wake）和电影《等着你回来》（My Boyfriend‘s Back）成为福克斯锤炼演技的重要一课。1994年，可以称得上是马修·福克斯事业真正腾飞的一年。当他经历了短暂的大银幕旅程之后，重新回到小荧幕中时，一部优秀的情景剧《五个人的聚会》（arty of Five）令马修一夜之间成了全美皆知的明星。这部由1994年一直边拍边演到2000年的电视剧集成就了一批像马修·福克斯这样的优秀年轻演员。不过，当时福克斯遇到《迷失》（Lost）之后，则迎来了自己攀登演艺事业又一高峰的天赐良机。也正是该剧集的急转直上的影响力，使得这位始终混迹于小荧屏的男人终于被那些目光挑剔的好莱坞制片人看中。当橄榄球队中的幸存者（《加油！马歇尔》）的角色并未在广大观众和挑剔的影评人眼中和口中留下多少甜头。反观其近年来独闯演艺圈的《迷失》剧集却持续火热。于是乎，马修亦愈发学得乖巧、本分起来，一心将自己的迷失道路无限地蔓延开去。带着曾经金球奖提名的光环，再闯大银幕。并在这部《刺杀疑云》中一跃成为主角，发挥空间亦效仿自己习惯的迷失套路。想来，马修此次的表现定能带给人们惊喜！而这位已然进入不惑之年的宾夕法尼亚人一定会在未来的演艺生涯中再创辉煌！……\r\n影片简评\r\n　　两年前的《撞车》、一年前的《通天塔》都用事实证明了多线叙事的表现手法已然成了当今国际影坛的时尚。曾经的《罗生门》，也转瞬在人们的记忆中再度清晰起来。英国人的《两杆老烟枪》，在国内掀起小制作类型片热潮的《疯狂的石头》，无不以各自的方式为这一传统而经典的电影表现手法添砖加瓦。\r\n　　而本片在此方面更是大胆有加，略有嫌疑地套用热门美剧《24小时》的故事框架，并以《迷失》的穿插倒叙、扑朔迷离的叙事风格，将总统遇刺的故事讲述出来。面积广阔的5个线索，几乎上各不相的8个主要人物，将刺杀总统的这一个交织纠缠得谜团重重、耐人寻味。令观众在欣赏进展激烈的商业动作片的同时，历经一场超智力的悬疑之旅。\r\n　　显然，影片如此打造的目的不纯，并非只单单考虑到竞争鲜见的季档日渐肥硕的市场。能在新一年里拿个什么奖项恐怕也在考虑之内。不过其赶在金球已逝，奥斯卡正当头的时候登场，显然时运不佳。而若是等到下一年的颁奖季，恐怕早已是长江后浪推前浪，前浪死在沙滩上！\r\n　　而且，纵观影片的主要着力点，似乎也并非全力在骨子里的叙事上，而是从影片视听角度以及商业味道上大做文章，爆炸、枪战、打斗、追逐……再火爆似乎也很难冲出《碟影重重》的包围。……来源：DVD Qvod 快播 土豆 优酷 迅雷下载 酷6 56高清 gvod，主演都不错吧，百度搜索刺杀疑云有利地形在线观看速酷电影 可以搜到我们哟，请大家记住我们免费更新最快的速酷电影，好看电视剧，最新电影，最新电视剧，免费电影，热播电视剧，最新热播大片都在我们suku','<div class=\"play_list\" id=\"v1\">\n<ul>\n <li>\n  <a title=\"刺杀疑云\" href=\"/film17/7198/play-0-0.html\" target=\"_self\">\n   刺杀疑云\n  </a>\n </li>\n</ul>\n</div>\n',8,'http://pmpic.net/pic/upload/200862616453466856.jpg','未录入'),
